import React from "react";
import "./App.css";
import styled from "styled-components";
import { Route, Link } from "react-router-dom";


function App() {

  return (
    <div className="App">
     Hello Kayla!
     <nav>
       <Link>Home</Link>
       <Link>Smile</Link>
       <Link>Quotes</Link>


       <Route path="/Login" render={props => <LoginForm {...props} />} />

     </nav>
    </div>
  );

  }
export default App;
